<?php
//CONFIGURATIONS
error_reporting(E_ALL ^ E_STRICT);
date_default_timezone_set('America/Sao_Paulo');

//Defaults
$root = __DIR__.'/';
if(strpos($root, 'phar://') !== false) $root = dirname(str_replace('phar://', '', $root)).'/';
$upload = $root.'upload/';

//Server ADDRESS
$wsPort = 8080;
$a = explode(':',$_SERVER['HTTP_HOST'])[0];

$url = 'http://'.$a;
$up = 'http://'.$a;
$ws = 'ws://'.$a.':'.$wsPort;

/*Creating upload dir if not exists
  ---  Comment it if UPLOAD in others server [address & location].*/
if(!is_dir($upload)){
    if(!mkdir($upload, 0777, true)) exit('Error: Upload directory can\'t created!');
}
if(fileperms($upload) !== 0777) {
    if(!chmod($upload, 0777)) exit('Error: Upload directory permission can\'t changed ['.fileperms($upload).' => 0777]!');
}

// ----------------------------------------------------------------------

//Rec. Files
if(isset($_POST['data'])) {
    $dt = json_decode($_POST['data']);

    if(isset($dt->file)){

        $name = md5(microtime(true));
        file_put_contents($upload.$name, base64_decode($dt->file));
        exit(json_encode(['name'=>$name]));
    }

    if(isset($dt->type) && $dt->type == 'get'){
        if(file_exists($upload.$dt->name)){
            $f = base64_encode(file_get_contents($upload.$dt->name));
            exit(json_encode(['name'=>$dt->name, 'file'=>$f]));
        }
    }
    exit('Nenhum arquivo!');
}

//Gerando ChannelKey && Password automáticamente ------------------------
$k = md5(microtime(true)) . md5(date('YmdHIs')) . md5(microtime(true)) . md5(microtime()) . md5(date('Y') . microtime(true));
$p = md5($k);


//Unificando a senha & channel para facilitar os testes - REMOVER -------
$p="1234567890"; $k="12345678901234567890";

