o dos recursos de seu aparelho (câmera, microfone, etc). Além disso, em casos extremos, seu celular pode ser vasculhado por terceiros que descobrirão os rastros de conversações não desejados (contatos, etc).</p><p>Enquanto nossos desenvolvedores e especialistas em segurança trabalham em uma versão APP (instalável) realmente segura, o Qzumba trabalha muito bem com <b>todos os dispositivos</b> que tenham navegadores que abrem páginas da web - desktops, notebooks, tablets, celulares, etc.</p><p>Navegadores e sistemas modernos serão, obviamente, mais compatíveis: sugerimos o navegador <b>CHROME</b> (da Google).</p><p>Para mais segurança ative a navegação <b>anônima (ou privada)</b> disponível na maioria dos modernos navegadores e utilize uma rede pública (wifi, lanhouse, cyber café).</p><h2>Versão BETA</h2><p>Não se esqueça que essa versão do software é BETA!. Ou seja, apesar de ter a segurança da criptografia EAS, podem ocorrer bugs (erros) inesperados!</p><p>Também não é possivel (ainda) agendar conversas e deixar recados. Um sistema de cadastro seguro está sendo desenvolvido para essa finalidade.</p><p>Caso ocorra algum erro durante o uso, por favor, nos reporte usando o formulário da página <a href="Qzumba.com/fale" target="new">Qzumba.com/fale</a>.</p><h2>HELP!!</h2><p>Ajude no desenvolvimento e manutenção do Qzumba fazendo uma doação usando os botões do PagSeguro.</p><div class="inline"><form action="https://pagseguro.uol.com.br/checkout/v2/donation.html" method="post"><input type="hidden" name="currency" value="BRL"/><input type="hidden" name="receiverEmail" value="prbr@ymail.com"/><input type="image" src="" class="d10" name="submit" alt="Pague com PagSeguro - é rápido, grátis e seguro!"/></form><form action="https://pagseguro.uol.com.br/v2/pre-approvals/request.html" method="post"><input type="hidden" name="code" value="6B0E4D583434A06BB4203F82E86C089D"/><input type="image" src="" class="a11" name="submit" alt="Pague com PagSeguro - é rápido, grátis e seguro!"/>